import {Link} from "react-router-dom";

function Header({
                    homeButtonColor,
                    catalogButtonColor,
                    cartButtonColor,
                    setHomeButtonColor,
                    setCatalogButtonColor,
                    setCartButtonColor,
                }) {
    return (
        <header>
            <div className="header">
                <nav className="header__nav">
                    <div className="header__nav-logo">
                        <img src="/icons/trolleybus-icon.png" alt="header_logo" width="80" height="80" />
                    </div>
                    <div className="header__nav-buttons">
                        <h2>
                            <button
                                type="button"
                                className="header__category1"
                                style={{ color: homeButtonColor }}
                                onClick={() => {
                                    setHomeButtonColor('white');
                                    setCatalogButtonColor('black');
                                    setCartButtonColor('black');
                                }}
                            >
                                <Link to="/Home">Home</Link>
                            </button>
                        </h2>
                        <h2>
                            <button
                                type="button"
                                className="header__category"
                                style={{ color: catalogButtonColor }}
                                onClick={() => {
                                    setHomeButtonColor('black');
                                    setCatalogButtonColor('white');
                                    setCartButtonColor('black');
                                }}
                            >
                                <Link to="/Catalog">Catalog</Link>
                            </button>
                        </h2>
                        <h2>
                            <button
                                type="button"
                                className="header__category"
                                style={{ color: cartButtonColor }}
                                onClick={() => {
                                    setHomeButtonColor('black');
                                    setCatalogButtonColor('black');
                                    setCartButtonColor('white');
                                }}
                            >
                                <Link to="/Cart">Cart</Link>
                            </button>
                        </h2>
                    </div>
                </nav>
            </div>
        </header>
    );
}

export default Header;
